// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";


/**@dev
Smart contract of the NFT assets inside the ecosystem.
 */
contract VrakkaNFT is ERC721URIStorage,Ownable{

    using Counters for Counters.Counter;

    ///////////////-----Variable-------------///////////
    Counters.Counter private _tokenIds;
    address[] acceptedCoins;

    mapping(address=>uint256) private COINS_PRICE;
    uint256 PRICE_NATIVE=10**16 wei; 

    uint256 private MAX_SUPPLY=12000;
    uint256 private MAX_SUPPLY_LEGENDARY=360;
    uint256 private MAX_SUPPLY_EPIC=1440;
    uint256 private MAX_SUPPLY_RARE=4200;
    uint256 private MAX_SUPPLY_NORMAL=6000;

    uint256 private SUPPLY_LEGENDARY;
    uint256 private SUPPLY_EPIC;
    uint256 private SUPPLY_RARE;
    uint256 private SUPPLY_NORMAL;

    string internal baseURI;

    constructor() ERC721("Vrakka NFT", "VRAKKA") {}

    struct Vrakka {
        uint256 tokenId;
        address payable currentOwner;
        address payable previousOwner;
        uint256 price;
        bool forSale;       
        uint256 blockNumber;
        uint256 time; 
        uint class;
    }

    mapping(uint256=>Vrakka) LIST ;



//-----------------MODIFICADORES--------------------------//

modifier onlyNFTOwner(uint256 _tokenId){
    address tokenOwner = ownerOf(_tokenId);
    require(tokenOwner == msg.sender,'only the NFT owner');
    _;
}

modifier checkHardCap(){
    uint256 currentSupply = getTotal();
    require(currentSupply<MAX_SUPPLY,'Hard Cap Reach');
    _;
}


modifier legalCoin(address _coin){
    bool pass=false;
    for (uint256 index = 0; index < acceptedCoins.length; index++) {
        if(acceptedCoins[index]==_coin){
            pass=true;
            break;
        }
    }
    require(pass,'not accepted coin');
    _;
}
//-------------------MODIFICADORES--------------------------//

function _beforeTokenTransfer(address from,address to,uint256 tokenId)internal override{
        Vrakka memory _vrakka = LIST[tokenId];
        // update the token's previous owner
        _vrakka.previousOwner = payable(from);
        // update the token's current owner
        _vrakka.currentOwner =payable(to);
        LIST[tokenId] = _vrakka;

}


/**
@dev
PrivateMinting function is only for the owner 
 */
function PrivateMinting(
    address who,
    uint256 _price,
    bool forSale
    ) external onlyOwner checkHardCap returns(uint256){

    //incrementamos en 1 el contador
    _tokenIds.increment();

    uint256 newItemId = _tokenIds.current();
    _mint(msg.sender, newItemId);
    // _setTokenURI(newItemId, _uri);


    uint _class=selectClass();

    updateSupplyClass(_class);

    Vrakka memory newVrakka= Vrakka(
    newItemId,//token id of VRAKKA NFT
    payable(who),
    payable(address(0)),
    _price,
    forSale,
    block.number,
    block.timestamp,
    _class
    );

    LIST[newItemId] = newVrakka;

    return newItemId;

}


/**
@dev
PublicMinting function lets any user to create their own NFT
base on 
 */
function PublicMinting(
    string memory _uri
    ) external payable checkHardCap returns(uint256){

    require(msg.value>=PRICE_NATIVE,'No the price');
    _tokenIds.increment();

    uint256 newItemId = _tokenIds.current();
    _mint(msg.sender, newItemId);
    _setTokenURI(newItemId, _uri);

    uint _class=selectClass();
    updateSupplyClass(_class);

    Vrakka memory newVrakka= Vrakka(
    newItemId,//token id of VRAKKA NFT
    payable(msg.sender),
    payable(address(0)),
    PRICE_NATIVE,
    false,
    block.number,
    block.timestamp,
    _class
    );

    LIST[newItemId] = newVrakka;

    return newItemId;

}


//Any user can call this function and mint their own Vrakkaficate 
function PublicMintingERC20(
    string memory _uri,
    address _token_address,
    bool forSale
    ) external legalCoin(_token_address) checkHardCap returns (uint256){

    uint256 _price=COINS_PRICE[_token_address];
    require(_price>0);
    bool succ=IERC20(_token_address).transferFrom(msg.sender, address(this), _price);
    require(succ,'txn didnt work');
    _tokenIds.increment();

    uint256 newItemId = _tokenIds.current();
    _mint(msg.sender, newItemId);
    _setTokenURI(newItemId, _uri);

    uint _class=selectClass();
    updateSupplyClass(_class);

    Vrakka memory newVrakka= Vrakka(
    newItemId,//token id of VRAKKA NFT
    payable(msg.sender),
    payable(address(0)),
    _price,
    forSale,
    block.number,
    block.timestamp,
    _class
    );

    LIST[newItemId] = newVrakka;

    return newItemId;

}

/////////////////////////////////////////////////////////////////////////////////////

function toggleForSale(uint256 _tokenId) public onlyNFTOwner(_tokenId){
  require(msg.sender != address(0));
  require(_exists(_tokenId));

  Vrakka memory _vrakka = LIST[_tokenId];

  // if token's forSale is false make it true and vice versa
  if(_vrakka.forSale) {
    _vrakka.forSale = false;
  } else {
    _vrakka.forSale = true;
  }
  // set and update that token in the mapping
  LIST[_tokenId] = _vrakka;
}

function toggleForSaleAndPrice(uint256 _tokenId,uint256 _price) public onlyNFTOwner(_tokenId){
  require(msg.sender != address(0));
  require(_exists(_tokenId));
  require(_price>0,'price cannot be 0');

  Vrakka memory _vrakka = LIST[_tokenId];

  // if token's forSale is false make it true and vice versa
  if(_vrakka.forSale) {
    _vrakka.forSale = false;
  } else {
    _vrakka.forSale = true;

  }
  //This function main goal is change the price
  _vrakka.price = _price;

  // set and update that token in the mapping
  LIST[_tokenId] = _vrakka;
}

function changePrice(uint256 _tokenId,uint256 _newPrice) public onlyNFTOwner(_tokenId){
  require(msg.sender != address(0));
  require(_exists(_tokenId));
  require(_newPrice>0,'price cannot be 0');

  Vrakka memory _vrakka = LIST[_tokenId];

  _vrakka.price = _newPrice;

  LIST[_tokenId] = _vrakka;
}


function buyToken(uint256 _tokenId) public payable returns(bool){
  require(msg.sender != address(0));
  require(_exists(_tokenId));
  // get the token's owner
  address tokenOwner = ownerOf(_tokenId);

  require(tokenOwner != address(0));
  require(tokenOwner != msg.sender);

  Vrakka memory _vrakka = LIST[_tokenId];

  require(msg.value >= _vrakka.price,'price has to be high');
  require(_vrakka.forSale,'hashima is not in sale');

  // get owner of the token
  address payable sendTo = _vrakka.currentOwner;
  // send token's worth of ethers to the owner
  (bool sent, ) = sendTo.call{value: msg.value}("");
  require(sent,'transaction not succesful');

  _transfer(tokenOwner, msg.sender, _tokenId);

  // update the token's previous owner
  _vrakka.previousOwner = _vrakka.currentOwner;
  // update the token's current owner
  _vrakka.currentOwner =payable(msg.sender);

  //Change market state, so there is no possibility of quick buy
  _vrakka.forSale=false;
  // set and update that token in the mapping
  LIST[_tokenId] = _vrakka;

  return sent;
}


function addCoin(address coinAddress)external onlyOwner{
    acceptedCoins.push(coinAddress);
}

function getPrice()external view returns(uint256){
    return PRICE_NATIVE;
}

/////////////----SETTERS----//////////////
function setPrice(uint256 _newPrice)external onlyOwner{
    PRICE_NATIVE=_newPrice;
}

function setPriceERC20(address coin,uint256 _newPrice)external onlyOwner{
    require(_newPrice>0,'price has to be more than 0');
    for (uint256 index = 0; index < acceptedCoins.length; index++) {

        if(acceptedCoins[index]==coin){
            COINS_PRICE[coin]=_newPrice;
            break;
        }
    }

}


function get(uint256 _index)public view returns(Vrakka memory){
        return LIST[_index];
}

function getClass(uint256 _index)public view returns(uint){
      return LIST[_index].class;
}

function getTotal()public view returns(uint256){
    return(_tokenIds.current());
}


/**
  * @dev
  3 Inputs for the Hash divided by the total number of minted NFTs: 
  -timestamp in unix time
  -difficulty of the blockchain
  -height of the current block
  */
function random() public view returns (uint8) {
  return uint8(uint256(keccak256(abi.encodePacked(block.timestamp, block.difficulty,block.number)))%100);
}


function selectClass()internal view returns(uint){
  uint8 randomNumber=random();
  uint class;
  bool pass=true;

  while(pass){
    if(randomNumber<=50){
      class=1;
    }else if(randomNumber<85){
      class=2;
    }else if(randomNumber<97){
      class=3;
    }else if(randomNumber<=100){
      class=4;
    }
    pass=checkSupply(class);

  }
  return class;
}

function checkSupply(uint _class)private view returns(bool){
  bool answer=false;
  if(_class==1){
    if(SUPPLY_NORMAL>=MAX_SUPPLY_NORMAL){
      answer=true;
    }
  }else if(_class==2){
    if(SUPPLY_RARE>=MAX_SUPPLY_RARE){
      answer=true;
    }

  }else if(_class==3){
    if(SUPPLY_EPIC>=MAX_SUPPLY_EPIC){
      answer=true;
    }

  }else if(_class==4){
    if(SUPPLY_LEGENDARY>=MAX_SUPPLY_LEGENDARY){
      answer=true;
    }

  }
  return answer;
}

function updateSupplyClass(uint _class)internal{
  if(_class==1){
    SUPPLY_NORMAL++;
  }else if(_class==2){
    SUPPLY_RARE++;
  }else if(_class==3){
    SUPPLY_EPIC++;
  }else if(_class==4){
    SUPPLY_LEGENDARY++;
  }
}

// function setBaseURI(string calldata newEntry)external onlyOwner{
//     baseURI=newEntry;
// }

// function tokenURI(uint256 tokenId) public view override returns (string memory) {
//     require(_exists(tokenId), "URI query for nonexistent token");
//     return string(abi.encodePacked(baseURI,Strings.toString(tokenId),".json"));
// }

}

